CREATE DEFINER=`root`@`localhost` FUNCTION `calculate_detection_accuracy`(
  p_spot_id INT,
  p_hours INT
) RETURNS decimal(5,2)
    READS SQL DATA
    DETERMINISTIC
BEGIN
  DECLARE v_total_detections INT;
  DECLARE v_high_confidence_detections INT;
  DECLARE v_accuracy DECIMAL(5,2);
  
  SELECT 
    COUNT(*),
    COUNT(CASE WHEN confidence_score >= 0.8 THEN 1 END)
  INTO v_total_detections, v_high_confidence_detections
  FROM detection_confidence_history
  WHERE parking_spot_id = p_spot_id
    AND detection_timestamp >= DATE_SUB(NOW(), INTERVAL p_hours HOUR);
  
  IF v_total_detections = 0 THEN
    RETURN NULL;
  END IF;
  
  SET v_accuracy = (v_high_confidence_detections / v_total_detections) * 100;
  
  RETURN v_accuracy;
END ;;
