CREATE DEFINER=`root`@`localhost` PROCEDURE `check_mode_switch_safety`(
  IN p_spot_id INT,
  IN p_target_mode ENUM('manual', 'ai'),
  OUT p_is_safe BOOLEAN,
  OUT p_warnings JSON,
  OUT p_blockers JSON
)
BEGIN
  DECLARE v_current_mode ENUM('manual', 'ai');
  DECLARE v_active_bookings INT;
  DECLARE v_seconds_since_scan INT;
  
  -- Get current state
  SELECT 
    detection_mode,
    TIMESTAMPDIFF(SECOND, last_ai_scan, NOW())
  INTO v_current_mode, v_seconds_since_scan
  FROM parking_spots
  WHERE id = p_spot_id;
  
  -- Count active bookings
  SELECT COUNT(*) INTO v_active_bookings
  FROM bookings b
  JOIN parking_slots sl ON b.slot_id = sl.id
  WHERE sl.parking_spot_id = p_spot_id AND b.status = 'active';
  
  -- Build warnings array
  SET p_warnings = JSON_ARRAY();
  
  IF v_active_bookings > 0 THEN
    SET p_warnings = JSON_ARRAY_APPEND(
      p_warnings,
      '$',
      JSON_OBJECT(
        'type', 'active_bookings',
        'message', CONCAT(v_active_bookings, ' active booking(s) will be preserved'),
        'severity', 'medium',
        'count', v_active_bookings
      )
    );
  END IF;
  
  -- Build blockers array
  SET p_blockers = JSON_ARRAY();
  
  -- No hard blockers for browser-based detection
  -- (Camera health checks removed since no Python service)
  
  -- Determine if safe
  SET p_is_safe = (JSON_LENGTH(p_blockers) = 0);
  
END ;;
