DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `rollback_mode_switch`(
  IN p_history_id INT,
  IN p_user_id INT,
  OUT p_success BOOLEAN,
  OUT p_message VARCHAR(255)
)
BEGIN
  DECLARE v_spot_id INT;
  DECLARE v_previous_mode ENUM('manual', 'ai');
  DECLARE v_snapshot JSON;
  DECLARE v_active_bookings INT;
  DECLARE v_already_rolled_back BOOLEAN;
  
  -- Get history record
  SELECT 
    parking_spot_id, 
    previous_mode, 
    slots_state_snapshot,
    rollback_completed
  INTO 
    v_spot_id, 
    v_previous_mode, 
    v_snapshot,
    v_already_rolled_back
  FROM detection_mode_history
  WHERE id = p_history_id;
  
  -- Validate
  IF v_spot_id IS NULL THEN
    SET p_success = FALSE;
    SET p_message = 'History record not found';
    
  ELSEIF v_already_rolled_back = TRUE THEN
    SET p_success = FALSE;
    SET p_message = 'This change has already been rolled back';
    
  ELSE
    -- Check for active bookings
    SELECT COUNT(*) INTO v_active_bookings
    FROM bookings b
    JOIN parking_slots sl ON b.slot_id = sl.id
    WHERE sl.parking_spot_id = v_spot_id AND b.status = 'active';
    
    IF v_active_bookings > 0 THEN
      SET p_success = FALSE;
      SET p_message = CONCAT('Cannot rollback: ', v_active_bookings, ' active booking(s) present');
      
    ELSE
      START TRANSACTION;
      
      -- Take snapshot before rollback
      INSERT INTO slot_state_snapshots 
        (parking_spot_id, snapshot_type, detection_mode, snapshot_data, created_by)
      SELECT 
        v_spot_id,
        'pre_rollback',
        detection_mode,
        JSON_ARRAYAGG(
          JSON_OBJECT(
            'slot_id', id,
            'slot_number', slot_number,
            'is_active', is_active,
            'is_available', is_available,
            'detection_source', detection_source,
            'slot_region', slot_region
          )
        ),
        p_user_id
      FROM parking_slots
      WHERE parking_spot_id = v_spot_id;
      
      -- Restore previous mode
      UPDATE parking_spots
      SET detection_mode = v_previous_mode,
          ai_detection_enabled = (v_previous_mode = 'ai'),
          browser_detection_active = FALSE,
          grid_initialized = (v_previous_mode = 'ai')
      WHERE id = v_spot_id;
      
      -- Mark history as rolled back
      UPDATE detection_mode_history
      SET rollback_completed = TRUE,
          rollback_at = NOW(),
          rollback_by = p_user_id
      WHERE id = p_history_id;
      
      -- Create notification
      INSERT INTO owner_notifications 
        (owner_id, parking_spot_id, notification_type, severity, message)
      SELECT 
        owner_id,
        v_spot_id,
        'mode_switch_rollback',
        'warning',
        CONCAT('Mode switch rolled back to ', v_previous_mode, ' mode')
      FROM parking_spots
      WHERE id = v_spot_id;
      
      COMMIT;
      
      SET p_success = TRUE;
      SET p_message = CONCAT('Successfully rolled back to ', v_previous_mode, ' mode');
    END IF;
  END IF;
END ;;
DELIMITER ;
